const location = useLocation()
const user = 1;
const navigate = useNavigate()

var questionsList = [{  
    _id: 1, 
    upVotes: 3, 
    downVotes: 2,
    no0fAnswers: 2, 
    questionTitle: "What is a function?", 
    questionBody: "Ans 1", 
