    questionBody: "Ans 2", 
    questionTags: ["java","node js","react js"], 
    userPosted: "Sinch",
    userId:1, 
    askedOn: "jan 1" ,
    answer: [{
      answerBody: "Answer",
      userAnswered: "kumar",
      answeredOn: "jan 2",
      userId: 2
    }]
  },{
    _id: 3, 
    upVotes: 3, 
    downVotes: 2,
    no0fAnswers: 2, 
    questionTitle: "What is a function?", 
    questionBody: "Ans 3", 
    questionTags: ["java","node js","react js"], 
    userPosted: "Sinch",
    userId:1, 
    askedOn: "jan 1" ,
    answer: [{
      answerBody: "Answer",
      userAnswered: "kumar",
      answeredOn: "jan 2",
      userId: 2
    }]
  }]


  // const checkAuth = () => {
